import React from 'react';

import '../../styles/components/layout/Header.css';

const Header= (props)=>{
    return (
        <header>
            <div className='holder'>
            <img scr="img/planta.jp.png" width={100} alt="plantasyotrashierbas"/> 
            </div>
        </header>
    );
};



export default Header;
